    // 初始化关联学校数据
    initAssociationSchool: function() {
        let res = EXAM.glxx;
        console.log(res)
        function dataType(data) {
            var map = {},
                result = [];
            for (var i = 0; i < data.length; i++) {
                var ai = data[i];
                if (!map[ai.province]) {
                    result.push({
                        province: ai.province,
                        data: [ai]
                    });
                    map[ai.province] = ai;
                } else {
                    for (var j = 0; j < result.length; j++) {
                        var dj = result[j];
                        if (dj.province == ai.province) {
                            dj.data.push(ai);
                            break;
                        }
                    }
                }
            }
            return result;
        }

        function dataCity(data) {
            var map = {},
                result = [];
            for (var i = 0; i < data.length; i++) {
                var ai = data[i];
                if (!map[ai.city]) {
                    result.push({
                        city: ai.city,
                        data: [ai]
                    });
                    map[ai.city] = ai;
                } else {
                    for (var j = 0; j < result.length; j++) {
                        var dj = result[j];
                        if (dj.city == ai.city) {
                            dj.data.push(ai);
                            break;
                        }
                    }
                }
            }
            return result;
        }
        var province = dataType(res);
        var html = '';
        for (var i = 0; i < province.length; i++) {
            var dataCt = dataCity(province[i].data);
            var city = '';
            for (var j = 0; j < dataCt.length; j++) {
                var dataSchName = dataCt[j].data;
                var schName = '';
                for (var l = 0; l < dataSchName.length; l++) {
                    schName += `<li data-id="${dataSchName[l].schId}">(${dataSchName[l].schId}) ${dataSchName[l].schName}</li>`;
                };
                city += `<h4>${dataCt[j].city}</h4><ul>${schName}</ul>`;
            }
            html += `<dt class="province-title">${province[i].province}</dt><dd>${city}</dd>`;
        };
        $('#schoolSelect').html(html);
    },
